import React from "react";

/* Images */
import logo from '../imgs/components/logo_school.png'

/* StyleSheet */
import './footer.css'

export function Footer() {
  return (
    <div className="footer">
        <div className="main-section">
          <div className="logo">
            <img src={logo} />
          </div>
        </div>
        <div className="sponsor-section"></div>
    </div>
  );
}
